body {
        margin: 0;
        overflow-x: hidden;
}

html {
    font-family: 'Raleway', sans-serif;
}


pre {
    font-family: 'Raleway', sans-serif;
    text-align: center;
}

iframe{
    text-align: center;
    width: 80%;
}
/* CABECERA Y LOGO*/
.text_inicial{
    display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
    justify-content: space-around;
    margin: 0 auto;
    width:100%; /* Establecemos que el ancho sera del 100% */
    max-width:100%; /* Aqui le decimos que el ancho máximo sera de 1000px */
    overflow:hidden; /* Eliminamos errores de float */
    /*background:#252932;*/
    font-size: 21px;
    line-height:20px;
    color: black;
    font-family: 'Raleway', sans-serif;
}




/*NAV HOME*/

* {
    margin: 0;
    padding: 0;
}

header {
	width:100%; /* Establecemos que el header abarque el 100% del documento */

}

header nav {
    width:90%;
    z-index: 1;
	max-width:1000px;
	margin:20px auto;
    background:white;
}
 
.menu_bar {
	display:none;
}
 
header nav ul {
	overflow:hidden;
	list-style:none;
}
 
header nav ul li {
	float:left;
}
 
header nav ul li a {
    color: #77AFDF;
	padding:20px;
	display:block;
	text-decoration:none;
}
 
header nav ul li span {
	margin-right:10px;
}
 
header nav ul li a:hover {
    background:white;
}
 
section {
	padding:20px;
}
 
@media screen and (max-width:800px ) {
	header nav {
		width:80%;
		height:100%;
		left:-100%;
		margin:0;
		position: fixed;
	}
 
	header nav ul li {
		display:block;
		float:none;
		border-bottom:1px solid rgba(255,255,255, .3);
	}
 
	.menu_bar {
		display:block;
		width:100%;
		background:white;
	}
 
	.menu_bar .bt-menu {
		display:block;
		padding:20px;
		background:white;
		color: #77AFDF;
		text-decoration:none;
		font-weight: bold;
		font-size:25px;
		-webkit-box-sizing:border-box;
		-moz-box-sizing:border-box;
		box-sizing:border-box;
	}
 
	.menu_bar span {
		float:right;
		font-size:40px;
	}
}

/* TEXTO ANIMADO */

.letraindex {
    animation-duration: 3s;
    animation-name: slidein;
    font-size: 20px;
    overflow: hidden;
  }
  
  @keyframes slidein {
    from {
      margin-left: 100%;
      width: 300%
    }
  
    to {
      margin-left: 0%;
      width: 100%;
    }
  }


/*IMAGEN BOTON ANIMADA */
.container {
    padding-bottom: 20px;
  }
  .container:hover .forward {
      cursor: pointer;
      -webkit-animation: scale 2s forwards;
      animation: scale 2s forwards;
    }
  
  h5 {
    color: #A1C1E2;
    font-family: 'Raleway', sans-serif;
    font-size: 20px;
    margin: 30px auto 5px;
    padding: 20px;
    text-align: left;
    margin-bottom: 10px;
  }

  .garcialorcafotodos {
    width: 40%;
    height: 40%;
  }
  
  .forward {
    border-radius: 5px;
    color: white;
    font-family: 'Raleway', sans-serif;
    font-weight: 200;
    font-size: 25px;
    margin:0;
    padding: 20px;
    text-align: left;
    width: 400px;
  }
  
  @-webkit-keyframes scale {
    0% {
      transform: scale(1);
       -webkit-transform: scale(-50px);
    }
    
    100% {
      transform: scale(1.3);
      -webkit-transform: scale(1.3);
    }
  }
  
  @keyframes scale {
    0% {
      transform: scale(1);
       -webkit-transform: scale(-50px);
    }
    
    100% {
      transform: scale(1.3);
      -webkit-transform: scale(1.3);
    }
  }

  
